export function groupAttributesBySet(attributes) {
  if (!Array.isArray(attributes)) {
    return {};
  }

  return attributes.reduce((acc, attribute) => {
    const setName = attribute.attribute_set.name;
    if (!acc[setName]) {
      acc[setName] = [];
    }
    acc[setName].push(attribute);
    return acc;
  }, {});
}
